import { useState } from 'react'
import {Box, styled} from '@mui/material'
import { green } from '@mui/material/colors';

const GameBoard = styled(Box)({
  width: 300,
  height: 300,
  backgroundColor: green,
  display: 'flex',
  justifyContent: 'center',
  alignItems: 'center',
})

function App() {

  return (
    <GameBoard />
  )
}

export default App;
